import React from 'react'
import './logo.scss'
import { Link } from 'react-router-dom';
import { useTranslation } from "react-i18next";
import "../../translations/i18n";
import { Settings, School } from "@material-ui/icons"


export default function DiidxazaLogo(props) {
    const { t } = useTranslation();

    return (
        <div>
            <Link className={props.style-link} to="/home">
                <School className={props.style-icon} />
                <span className={props.style-text}>{t("LogoName")}</span>
            </Link>
        </div>
    )
}
